import './ExpenseItem.css';

function ExpenseItem() {
   return (<div className='expense-item'>
    <div>May 5 1995</div>
    <div className='expense-item__description'><h2 className='expense-item h2'>Title</h2>
    <div>Amount</div>
    </div>
   </div>);
}
export default ExpenseItem;
